package model.jsoninfo;

public class study108 {
	
	private String 序號,類別,課程名稱,日期,時間,參加人數;

	public study108() {
		super();
		// TODO Auto-generated constructor stub
	}

	public study108(String 序號, String 類別, String 課程名稱, String 日期, String 時間, String 參加人數) {
		super();
		this.序號 = 序號;
		this.類別 = 類別;
		this.課程名稱 = 課程名稱;
		this.日期 = 日期;
		this.時間 = 時間;
		this.參加人數 = 參加人數;
	}

	public String get序號() {
		return 序號;
	}

	public void set序號(String 序號) {
		this.序號 = 序號;
	}

	public String get類別() {
		return 類別;
	}

	public void set類別(String 類別) {
		this.類別 = 類別;
	}

	public String get課程名稱() {
		return 課程名稱;
	}

	public void set課程名稱(String 課程名稱) {
		this.課程名稱 = 課程名稱;
	}

	public String get日期() {
		return 日期;
	}

	public void set日期(String 日期) {
		this.日期 = 日期;
	}

	public String get時間() {
		return 時間;
	}

	public void set時間(String 時間) {
		this.時間 = 時間;
	}

	public String get參加人數() {
		return 參加人數;
	}

	public void set參加人數(String 參加人數) {
		this.參加人數 = 參加人數;
	}
	

}
